function App() {
  const date = new Date();
  const hrs = 13;
  let cssStyle = {};
  let greeting = "";
  if (hrs > 1 && hrs < 12) {
    greeting = "Good Morning";
    cssStyle.color = "green";
  } else if (hrs > 12 && hrs < 20) {
    greeting = "Good Afternoon";
    cssStyle.color = "orange";
  } else {
    greeting = "Good Night";
    cssStyle.color = "gray";
  }
  console.log(greeting);
  return (
    <>
      <h1>
        Hellow,<span style={cssStyle}>{greeting}</span>
      </h1>
    </>
  );
}

export default App;
